import React, { useEffect } from "react";

const League = props => {
  const url = "https://api.football-data.org/v2/competitions/PL";
  const token = "52c8d88969d84ac9b17edb956eea33af";
  useEffect(() => {
    fetch(url, { headers: { "X-Auth-Token": token } }).then(res =>
      console.log(res)
    );
    return <div></div>;
  });
  return <p>ihi</p>;
};

export default League;
